import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
import Navbar from "./Navbar/Navbar";

function Admin() {
  const [data, setData] = useState([]);
  useEffect(() => {
  getData()

  }, []);

  async function getData() {
    let response = await axios.get("http://localhost:4500/cropdata/");
    console.log(response.data)
    setData(response.data)
  }

 
  return (
    <>
      <Navbar />
      <div>
        <main class="admin-data">
          <h1>User Info</h1>
          <table class="user-table" border={1}>
            <thead>
              <tr>
                <th>crop</th>
                <th>season</th>
                <th>soil type</th>
                <th>season</th>
                <th>cultivation date</th>
                <th>expected yeild date</th> 
                 <th>state</th>
                <th>District</th>
                <th>taluka</th>
                <th>village</th>
                {/* <th>Farmer Image</th>
                    <th>7/12 Image</th>
                    <th>8A Image</th> */}
              </tr>
            </thead>

            <tbody border>
              {data.map((farmer) => {
                return (
                  <tr>
                    {/* <td>{farmer.id}</td> */}
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    {/* <td>{farmer.fimg}</td>
                       <td>{farmer.seventimg}</td>
                       <td>{farmer.eightAimg}</td> */}

                    {/* <td>
                           <button className="read-btn"><Link to={`/read/${student.id}`}>Read</Link></button> 
                           <button className="edit-btn"><Link to={`/edit/${student.id}`}>Edit</Link></button>
                           <button className="delete-btn"><Link onClick={()=>handleDelete(student.id)}>Delete</Link></button>
                       </td> */}
                  </tr>
                );
              })}
            </tbody>
          </table>
        </main>
      </div>
    </>
  );
}

export default Admin;
